pub struct Filter {
    green: [Option<char>; 5],
    yellow: Vec<(char, usize)>,
    gray: Vec<(char, usize)>,
}

impl Filter {
    pub fn new() -> Self {
        Self {
            green: [None; 5],
            yellow: Vec::with_capacity(26 * 5),
            gray: Vec::with_capacity(26 * 5),
        }
    }

    pub fn add_green(mut self, index: usize, c: char) -> Self {
        self.green[index] = Some(c);
        self
    }

    pub fn add_yellow(mut self, index: usize, c: char) -> Self {
        self.yellow.push((c, index));
        self
    }

    pub fn add_gray(mut self, index: usize, c: char) -> Self {
        self.gray.push((c, index));
        self
    }

    pub fn matches(&self, word: &[char; 5]) -> bool {
        // Green must match
        for (i, g) in self.green.iter().enumerate() {
            if let Some(expected) = g {
                if word[i] != *expected {
                    return false;
                }
            }
        }

        // Yellow: wrong index, but must exist elsewhere
        for &(c, i) in &self.yellow {
            if word[i] == c || !word.contains(&c) {
                return false;
            }
        }

        // Gray: must not match index, and if not used in green/yellow, must not appear at all
        for &(c, i) in &self.gray {
            if word[i] == c {
                return false;
            }

            let used_elsewhere = self.green.iter().any(|&g| g == Some(c))
                || self.yellow.iter().any(|&(yc, _)| yc == c);

            if !used_elsewhere && word.contains(&c) {
                return false;
            }
        }

        true
    }
}
